class TaskC {
public:
	void solve(std::istream& in, std::ostream& out) {
		string s;
		in >> s;
		for (int i: range(1,  (int)s.size())) {
			if (s[i] == s[i - 1]) {
				out << "Impossible\n";
				return;;
			}
		}

		bool found = false;
		int diff;
		for (int i: range(s.size())) {
			for (int j: range(i)) {
				if (s[i] == s[j]) {
					cerr << i << ' ' << j << endl;
					rotate(s.begin(), s.begin() + j, s.end());
					diff = i - j;
					found = true;
					break;
				}
			}
			if (found) {
				break;
			}
		}
		assert(found);


		vector<pair<int, int>> poses;
		int start = (diff - 1) / 2;
		for (int i: inclusiveDownrange(start, 0)) {
			poses.emplace_back(0, i);
		}
		for (int i: range(13)) {
			poses.emplace_back(1, i);
		}

		for (int i: inclusiveDownrange(12, start + 1)) {
			poses.emplace_back(0, i);
		}

		vector<string> v(2, string(13, ' '));
		assert(s[0] == s[diff]);
		s.erase(s.begin() + diff);
		//for (char c: s) {
		//	cerr << c << endl;
		//}
		for (int i: range(26)) {
			auto p = poses[i];
			v[p.first][p.second] = s[i];
		}

		out << v[0] << "\n" << v[1] << "\n";
	}
};


